import axios from "axios";
import React, { useEffect, useState } from "react";
import starwars from "../../image/starwars.png";
import "./Exercise2.scss";

const Exercise2 = () => {
  const [data, setData] = useState([]);
  const [count, setCount] = useState(0);
  const [speed, setSpeed] = useState(0);
  const [cost, setCost] = useState("");
  const [passengers, setPassengers] = useState(0);
  const [film, setFilm] = useState(0);
  const [count2, setCount2] = useState(0);
  const [speed2, setSpeed2] = useState(0);
  const [cost2, setCost2] = useState("");
  const [passengers2, setPassengers2] = useState(0);
  const [film2, setFilm2] = useState(0);
  const [dataCard, setDataCard] = useState({});

  useEffect(() => {
    try {
      (async function () {
        let arr = [];
        let page = 1;
        let res = await axios.get(
          `https://swapi.dev/api/starships/?page=${page}`
        );
        let data = res && res.data ? res.data : [];
        arr = arr.concat(data.results);
        console.log("array 1:", arr);
        if (data.next) {
          page += 1;
          let res = await axios.get(
            `https://swapi.dev/api/starships/?page=${page}`
          );
          arr = arr.concat(res.data.results);
          console.log("array 2:", page, arr);
          if (res.data.next) {
            page += 1;
            let res = await axios.get(
              `https://swapi.dev/api/starships/?page=${page}`
            );
            arr = arr.concat(res.data.results);
            console.log("array 3:", page, arr);
            setData(arr);
            if (res.data.next) {
              page += 1;
              let res = await axios.get(
                `https://swapi.dev/api/starships/?page=${page}`
              );
              arr = arr.concat(res.data.results);
              console.log("array 4:", page, arr);
              setData(arr);
              if (res.data.next) {
                page += 1;
                let res = await axios.get(
                  `https://swapi.dev/api/starships/?page=${page}`
                );
                arr = arr.concat(res.data.results);
                console.log("array 4:", page, arr);
                setData(arr);
              } else {
                console.log("đã hết dữ liệu");
                return arr;
              }
            } else {
              console.log("đã hết dữ liệu");
              return arr;
            }
          }
        }
        // setData(data);
        console.log(" data: ", data);
      })();
    } catch (error) {
      console.log(error);
    }
  }, []);
  return (
    <div className="container2">
      {/* <h1>Hello cac ban</h1> */}
      <div className="header-scores">
        <span>0</span>
        <span>1</span>
      </div>
      <div className="body">
        <div className="body-item">
          <div className="body-title">Snowspeeder</div>
          <div className="body-image">
            <img src={starwars} alt="" />
          </div>
          <div className="body-list">
            <div className="item">
              <span>Max Speed</span>
              <span>650</span>
            </div>
            <div className="item">
              {" "}
              <span>Credit</span>
              <span>unknown</span>
            </div>
            <div className="item">
              {" "}
              <span>Passengers</span>
              <span>0</span>
            </div>
            <div className="item">
              {" "}
              <span>Film Appearances</span>
              <span>1</span>
            </div>
          </div>
        </div>
        <div className="body-item">
          <div className="body-title">Storm TV Twin-Pod cloud car</div>
          <div className="body-image">
            <img src={starwars} alt="" />
          </div>
          <div className="body-list">
            <div className="item">
              <span>Max Speed</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Credit</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Passengers</span>
              <span>?</span>
            </div>
            <div className="item">
              {" "}
              <span>Film Appearances</span>
              <span>?</span>
            </div>
          </div>
        </div>
      </div>
      {/* <div className="footter">
        <button>Play Random</button>
      </div> */}
    </div>
  );
};

export default Exercise2;
